yle=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">0</span>\"  \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">1</span>\"</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\"> \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">First</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\", \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">Second</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\" \"</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">Draw</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\"</span></p>','3\n110110\n001001','First','0','<p>gamesgreedy</p>','','2016-07-13 23:32:43',2,256,'N',1,1,0),(1020,'Array','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">Vitaly has an array of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;distinct integers. Vitaly wants to divide this array into three&nbsp;<span class=\"tex-font-style-bf\" style=\"font-weight: bold;\">non-empty</span>&nbsp;sets so as the following conditions hold:</p>\n<ol style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">The product of all numbers in the first set is less than zero&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(&thinsp;&lt;&thinsp;0)</span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">The product of all numbers in the second set is greater than zero&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(&thinsp;&gt;&thinsp;0)</span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">The product of all numbers in the third set is equal to zero.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">Each number from the initial array must occur in exactly one set.</li>\n</ol>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Help Vitaly. Divide the given array.</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">The first line of the input contains integer&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(3&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;100)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">. The second line contains&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;space-separated distinct integers&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(|<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>|&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">3</span>)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;&mdash; the array elements.</span></p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the first line print integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>&thinsp;&gt;&thinsp;0)</span>&nbsp;&mdash; the number of elements in the first set. Then print&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>&nbsp;numbers &mdash; the elements that got to the first set.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the next line print integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>&thinsp;&gt;&thinsp;0)</span>&nbsp;&mdash; the number of elements in the second set. Then print&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span></span>&nbsp;numbers &mdash; the elements that got to the second set.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the next line print integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">3</span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">3</span>&thinsp;&gt;&thinsp;0)</span>&nbsp;&mdash; the number of elements in the third set. Then print&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">3</span></span>&nbsp;numbers &mdash; the elements that got to the third set.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The printed sets must meet the described conditions. It is guaranteed that the solution exists. If there are several solutions, you are allowed to print any of them.</p>','4\n-1 -2 -3 0','1 -1\n2 -3 -2\n1 0','1','<p>&nbsp;A300</p>\n<p class=\"p1\"><span class=\"s1\">brute force, constructive algorithms, implementation</span></p>','','2016-07-14 00:40:13',2,256,'Y',NULL,0,0),(1021,'Yaroslav and Sequence','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">Yaroslav has an array, consisting of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(2&middot;<em>n</em>&thinsp;-&thinsp;1)</span>&nbsp;integers. In a single operation Yaroslav can change the sign of exactly&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;elements in the array. In other words, in one operation Yaroslav can select exactly&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;array elements, and multiply each of them by -1.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Yaroslav is now wondering: what maximum sum of array elements can be obtained if it is allowed to perform any number of described operations?</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Help Yaroslav.</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">The first line contains an integer&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(2&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;100)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">. The second line contains&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">(2&middot;<em>n</em>&thinsp;-&thinsp;1)</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;integers &mdash; the array elements. The array elements do not exceed&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1000</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;in their absolute value.</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">In a single line print the answer to the problem &mdash; the maximum sum that Yaroslav can get.</span></p>','2\n50 50 50','150','0','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the first sample you do not need to change anything. The sum of elements equals&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">150</span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the second sample you need to change the sign of the first two elements. Then we get the sum of the elements equal to&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">100</span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">constructive algorithms</span></p>','C 301','2016-07-14 00:58:22',2,256,'Y',NULL,0,0),(1022,'The Closest Pair','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">Currently Tiny is learning Computational Geometry. When trying to solve a problem called \"The Closest Pair Of Points In The Plane\", he found that a code which gave a wrong time complexity got Accepted instead of Time Limit Exceeded.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The problem is the follows. Given&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;points in the plane, find a pair of points between which the distance is minimized. Distance between<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>)</span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>)</span>&nbsp;is&nbsp;<img src=\"data/1022/1022.png\" alt=\"\" />.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The pseudo code of the unexpected code is as follows:</p>\n<pre style=\"margin-top: 1.5em; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: Consolas, \'Lucida Console\', \'Andale Mono\', \'Bitstream Vera Sans Mono\', \'Courier New\', Courier; line-height: 21px; white-space: pre-wrap; word-wrap: break-word; color: #880000;\"><br />input n<br />for i from 1 to n<br />    input the i-th point\'s coordinates into p[i]<br />sort array p[] by increasing of x coordinate first and increasing of y coordinate second<br />d=INF        //here INF is a number big enough<br />tot=0<br />for i from 1 to n<br />    for j from (i+1) to n<br />        ++tot<br />        if (p[j].x-p[i].x&gt;=d) then break    //notice that \"break\" is only to be<br />                                            //out of the loop \"for j\"<br />        d=min(d,distance(p[i],p[j]))<br />output d</pre>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Here,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>tot</em></span>&nbsp;can be regarded as the running time of the code. Due to the fact that a computer can only run a limited number of operations per second,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>tot</em></span>&nbsp;should not be more than&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;in order not to get Time Limit Exceeded.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">You are a great hacker. Would you please help Tiny generate a test data and let the code get Time Limit Exceeded?</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">A single line which contains two space-separated integers&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;and&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>k</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">2&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;2000</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">,&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>k</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">).</span></p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">If there doesn\'t exist such a data which let the given code get TLE, print \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">no solution</span>\" (without quotes); else print&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;lines, and the&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>-th line contains two integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>,&thinsp;<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(|<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>|,&thinsp;|<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>|&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span>)</span>&nbsp;representing the coordinates of the&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>-th point.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The conditions below must be held:</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">All the points must be distinct.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">|<em>x</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>|,&thinsp;|<em>y</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>|&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">After running the given code, the value of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>tot</em></span>&nbsp;should be larger than&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>.</li>\n</ul>','4 3','0 0\n0 1\n1 0\n1 1','0','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">A 311</span></p>\n<p class=\"p1\"><span class=\"s1\">constructive algorithms, implementation</span></p>','','2016-07-15 00:04:06',2,256,'Y',NULL,0,0),(1023,'','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">ab:</p>\n<ol style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"></li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">aa1a2bb1b2<ol style=\"margin: 0px 0px 0px 1em; padding: 0px; list-style: lower-latin outside; font-size: 1em; line-height: 1.5em;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>&nbsp;= &nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>, &nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0;