onospace;\">ab</span>\" = \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">a</span>\" + \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">b</span>\", \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">ba</span>\" = \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">b</span>\" + \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">a</span>\"</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">aabaabaa</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">divide and conquer, hashing, sortings, strings</span></p>','','2016-07-15 00:44:37',2,256,'N',1,1,0),(1024,'','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">120. </p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">1</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">6</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1,</span>...,</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">6</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">1&thinsp;&le;&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;1000</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) &mdash; </span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">1</span></p>','1 2 1 2 1 2','13','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">:</span></p>\n<p><img src=\"/data/1024/1024.png\" alt=\"\" />&nbsp;</p>\n<p>&nbsp;</p>\n<p>brute force,geometry,math</p>','','2016-07-16 17:15:48',2,256,'N',4,6,0),(10001,'Good Substrings','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">Smart Beaver recently got interested in a new word game. The point is as follows: count the number of distinct good substrings of some string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>. To determine if a string is good or not the game uses rules. Overall there are&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;rules. Each rule is described by a group of three<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>p</em>,&thinsp;<em>l</em>,&thinsp;<em>r</em>)</span>, where&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em></span>&nbsp;is a string and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>l</em></span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>r</em></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>l</em>&thinsp;&le;&thinsp;<em>r</em>)</span>&nbsp;are integers. We&rsquo;ll say that string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;complies with rule&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>p</em>,&thinsp;<em>l</em>,&thinsp;<em>r</em>)</span>, if the number of occurrences of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;in string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em></span>&nbsp;lies between&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>l</em></span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>r</em></span>, inclusive. For example, string \"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">ab</span>\", complies with rules (\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">ab</span>\",&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">2</span>) and (\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">aab</span>\",&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0</span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span>), but does not comply with rules (\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">cd</span>\",&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">2</span>) and (\"<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">abab</span>\",&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0</span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span>).</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">A&nbsp;<span class=\"tex-font-style-it\" style=\"font-style: italic;\">substring</span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>[<em>l</em>...&nbsp;<em>r</em>]</span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(1&thinsp;&le;&thinsp;<em>l</em>&thinsp;&le;&thinsp;<em>r</em>&thinsp;&le;&thinsp;|<em>s</em>|)</span>&nbsp;of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>&thinsp;=&thinsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>...&nbsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">|<em>s</em>|</span></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">|<em>s</em>|</span>&nbsp;is a length of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>) is string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>l</em></span><em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>l</em>&thinsp;+&thinsp;1</span>...&nbsp;<em>s</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>r</em></span></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Consider a&nbsp;<span class=\"tex-font-style-it\" style=\"font-style: italic;\">number of occurrences&nbsp;</span>of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;in string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em></span>&nbsp;as a number of pairs of integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>l</em>,&thinsp;<em>r</em></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(1&thinsp;&le;&thinsp;<em>l</em>&thinsp;&le;&thinsp;<em>r</em>&thinsp;&le;&thinsp;|<em>p</em>|)</span>&nbsp;such that&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em>[<em>l</em>...&nbsp;<em>r</em>]&thinsp;=&thinsp;<em>t</em></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">We&rsquo;ll say that string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>t</em></span>&nbsp;is good if it complies with all&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;rules. Smart Beaver asks you to help him to write a program that can calculate the number of distinct good substrings of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>. Two substrings&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>[<em>x</em>...&nbsp;<em>y</em>]</span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>[<em>z</em>...&nbsp;<em>w</em>]</span>&nbsp;are cosidered to be distinct iff&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em>[<em>x</em>...&nbsp;<em>y</em>]&thinsp;&ne;&thinsp;<em>s</em>[<em>z</em>...&nbsp;<em>w</em>]</span>.</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The first line contains string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>. The second line contains integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>. Next&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;lines contain the rules, one per line. Each of these lines contains a string and two integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>,&thinsp;<em>l</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>,&thinsp;<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>, separated by single spaces (<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0&thinsp;&le;&thinsp;<em>l</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;|<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>|</span>). It is guaranteed that all the given strings are non-empty and only contain lowercase English letters.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The input limits for scoring 30 points are (subproblem G1):</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10</span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">The length of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>&nbsp;and the maximum length of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em></span>&nbsp;is&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;&le;&thinsp;200</span>.</li>\n</ul>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The input limits for scoring 70 points are (subproblems G1+G2):</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10</span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">The length of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>&nbsp;and the maximum length of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em></span>&nbsp;is&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;&le;&thinsp;2000</span>.</li>\n</ul>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The input limits for scoring 100 points are (subproblems G1+G2+G3):</p>\n<ul style=\"margin: 0.5em 0px 0px 1em; padding: 0px; list-style-position: outside; font-size: 14px; line-height: 21px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\"><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10</span>.</li>\n<li style=\"margin: 0px 0px 0px 0.8em; padding: 0px; line-height: 1.5em; font-size: 1em;\">The length of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>s</em></span>&nbsp;and the maximum length of string&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em></span>&nbsp;is&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;&le;&thinsp;50000</span>.</li>\n</ul>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">Print a single integer &mdash; the number of good substrings of string&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>s</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">.</span></p>','ltntlnen\n3\nn 0 0\nttlneenl 1 4\nlelllt 1 1','2','0','<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">In the second test only substrings &laquo;</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: &quot;courier new&quot;, monospace; color: rgb(34, 34, 34); line-height: 19.6px;\">e</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&raquo; and &laquo;</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: &quot;courier new&quot;, monospace; color: rgb(34, 34, 34); line-height: 19.6px;\">t</span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&raquo; are good.</span></p>\n<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">string suffix structures</span></p>','','2016-07-17 02:17:12',4,256,'Y',NULL,0,0),(10004,'','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\"></p>\n<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\"><em style=\"font-size: 17.5px; line-height: 19.6px;\">n</em><span style=\"font-size: 17.5px; line-height: 19.6px;\">&thinsp;&times;&thinsp;</span><em style=\"font-size: 17.5px; line-height: 19.6px;\">m</em><span style=\"line-height: 19.6px;\"></span><span class=\"tex-span\" style=\"font-size: 17.5px;\">1</span><span style=\"line-height: 19.6px;\">&nbsp; (n*m)/2,</span><span style=\"line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px;\">(<em>i</em>,&thinsp;<em>j</em>)</span><span style=\"line-height: 19.6px;\"></span><span style=\"line-height: 19.6px;\"></span><span class=\"tex-span\" style=\"font-size: 17.5px;\">(<em>i</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>j</em><span class=\"