"line-height: 19.6px;\">ASCII</span><span style=\"line-height: 19.6px;\"></span><span style=\"line-height: 19.6px;\">ASCII</span><span style=\"line-height: 19.6px;\">&lt;</span><span style=\"line-height: 19.6px;\"></span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">ASCII <span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">. @ ab</span>...<span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">z</span></p>','vasyaatgmaildotcom\n\ndotdotdotatdotdotat\n\naatt','vasya@gmail.com\n\ndot..@..at\n\na@t','0','<p>expression parsingimplementation</p>','','2016-07-20 15:53:08',2,256,'N',2,9,0),(10002,'Alyona and the Tree','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">Alyona decided to go on a diet and went to the forest to get some apples. There she unexpectedly found a magic rooted tree with root in the vertex&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span>, every vertex and every edge of which has a number written on.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The girl noticed that some of the tree\'s vertices are&nbsp;<span class=\"tex-font-style-it\" style=\"font-style: italic;\">sad</span>, so she decided to play with them. Let\'s call vertex&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em></span>&nbsp;<span class=\"tex-font-style-it\" style=\"font-style: italic;\">sad</span>&nbsp;if there is a vertex&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>u</em></span>&nbsp;in subtree of vertex&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em></span>&nbsp;such that&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>dist</em>(<em>v</em>,&thinsp;<em>u</em>)&thinsp;&gt;&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>u</em></span></span>, where&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>u</em></span></span>&nbsp;is the number written on vertex&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>u</em></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>dist</em>(<em>v</em>,&thinsp;<em>u</em>)</span>&nbsp;is the sum of the numbers written on the edges on the path from&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>v</em></span>&nbsp;to&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>u</em></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span class=\"tex-font-style-it\" style=\"font-style: italic;\">Leaves</span>&nbsp;of a tree are vertices connected to a single vertex by a single edge, but the root of a tree is a&nbsp;<span class=\"tex-font-style-it\" style=\"font-style: italic;\">leaf</span>&nbsp;if and only if the tree consists of a single vertex&nbsp;&mdash; root.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Thus Alyona decided to remove some of tree leaves until there will be no any sad vertex left in the tree. What is the minimum number of leaves Alyona needs to remove?</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the first line of the input integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">5</span></span>) is given&nbsp;&mdash; the number of vertices in the tree.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">In the second line the sequence of&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;...,&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>n</em></span></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span></span>) is given, where&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;is the number written on vertex&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The next&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em>&thinsp;-&thinsp;1</span>&nbsp;lines describe tree edges:&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em><span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><em>th</em></span></span>&nbsp;of them consists of two integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(1&thinsp;&le;&thinsp;<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;<em>n</em></span>,&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">&thinsp;-&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span>&thinsp;&le;&thinsp;<em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">9</span>)</span>, meaning that there is an edge connecting vertices&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em>&thinsp;+&thinsp;1</span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;with number&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;written on it.</p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">Print the only integer&nbsp;&mdash; the minimum number of leaves Alyona needs to remove such that there will be no any sad vertex left in the tree.</span></p>','9\n88 22 83 14 95 91 98 53 11\n3 24\n7 -8\n1 67\n1 64\n9 65\n5 12\n6 -80\n3 8','5','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">The following image represents possible process of removing leaves from the tree:</span></p>\n<p><img src=\"/data/10002/10002.png\" alt=\"\" />&nbsp;</p>\n<p>dfs and similardptrees</p>\n<p><span style=\"font-family: verdana, arial, sans-serif; font-size: 17.5px; text-align: center;\">C 682</span></p>','','2016-07-21 01:04:34',1,256,'Y',NULL,0,0),(116,'','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\"></span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\">2&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;1000</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">) </span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\"H\"  \"T\" </span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">\"H\"  \"T\"</span></p>','<p>&nbsp;</p>\n<div class=\"output-specification\" style=\"margin: 0px 0px 1em; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\"></p>\n</div>','\n3\nHTH\n\n\n9\nHTHTHTHHT','0\n\n2','0','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">2597</span></p>\n<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">two pointers</span></p>','','2016-07-21 10:38:18',2,256,'N',1,7,0),(1030,'Toys','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">Little Masha loves arranging her toys into piles on the floor. And she also hates it when somebody touches her toys. One day Masha arranged all her&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">&nbsp;toys into several piles and then her elder brother Sasha came and gathered all the piles into one. Having seen it, Masha got very upset and started crying. Sasha still can\'t calm Masha down and mom is going to come home soon and punish Sasha for having made Masha crying. That\'s why he decides to restore the piles\' arrangement. However, he doesn\'t remember at all the way the toys used to lie. Of course, Masha remembers it, but she can\'t talk yet and can only help Sasha by shouting happily when he arranges the toys in the way they used to lie. That means that Sasha will have to arrange the toys in every possible way until Masha recognizes the needed arrangement. The relative position of the piles and toys in every pile is irrelevant, that\'s why the two ways of arranging the toys are considered different if can be found two such toys that when arranged in the first way lie in one and the same pile and do not if arranged in the second way. Sasha is looking for the fastest way of trying all the ways because mom will come soon. With every action Sasha can take a toy from any pile and move it to any other pile (as a result a new pile may appear or the old one may disappear). Sasha wants to find the sequence of actions as a result of which all the pile arrangement variants will be tried exactly one time each. Help Sasha. As we remember, initially all the toys are located in one pile.</span></p>','<p>&nbsp;</p>\n<div class=\"input-specification\" style=\"margin: 0px; padding: 0px; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 1em; line-height: 1.4em;\">The first line contains an integer&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em style=\"font-style: italic;\">n</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em style=\"font-style: italic;\">n</em>&thinsp;&le;&thinsp;10</span>) &mdash; the number of toys.</p>\n</div>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">In the first line print the number of different variants of arrangement of toys into piles. Then print all the ways of arranging toys into piles in the order in which Sasha should try them (i.e. every next way must result from the previous one through the operation described in the statement). Every way should be printed in the following format. In every pile the toys should be arranged in ascending order of the numbers. Then the piles should be sorted in ascending order of the numbers of the first toys there. Output every way on a single line. Cf. the example to specify the output data format. If the solution is not unique, output any of them.</span></p>','3','5\n{1,2,3}\n{1,2},{3}\n{1},{2,3}\n{1},{2},{3}\n{1,3},{2}','0','<p>brute forcecombinatorics</p>\n<p>44I special judge</p>','','2016-07-21 13:04:51',5,256,'Y',NULL,0,0),(1031,'School','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">n<span style=\"line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>g</em>(<em>i</em>) </span><span style=\"line-height: 1.4em;\"></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span><span style=\"line-height: 1.4em;\">&nbsp;</span><span style=\"line-height: 1.4em;\"></span><em>g</em><span>(</span><em>i</em><span>)</span><span style=\"line-height: 1.4em;\">&nbsp;</span><span style=\"line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>g</em>(<em>g</em>(<em>i</em>))</span><span style=\"line-height: 1.4em;\">&nbsp; &nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span><span style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\"></span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><span style=\"line-height: 19.6px;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span><span style=\"line-height: 19.6px;\">&nbsp;</span><em>a</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i </em></span><span style=\"line-height: 1.4em;\"></span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>b</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"line-height: 1.4em;\">&nbsp;(</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times 