</em></span><em>+&nbsp;</em><em style=\"line-height: 19.6px;\">res</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span><em>&nbsp;-1) mod n) +1&nbsp;</em></p>\n<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;\">where mod stands for the operation of taking the excess from the cleavage,&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 21px;\"><em>res</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">0</span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;\">&nbsp;is considered equal to zero and&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 21px;\"><em>v</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;\">&nbsp;&mdash; some given integers.</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">The first line contains two space-separated integers&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap; color: #222222; line-height: 19.6px;\"><em>n</em></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6p