 sans-serif; white-space: nowrap;\"><em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span>&nbsp;and column&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span></span> &nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;<em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>)</span>&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>,&thinsp;<em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">1</span>)</span> &nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">(<em>r</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>,&thinsp;<em>c</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>)</span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"><em>k</em>&thinsp;&times;&thinsp;<em>k</em><span style=\"line-height: 1.4em;\"></span><em>k</em>&thinsp;&times;&thinsp;<em>k</em><span style=\"line-height: 1.4em;\"></span></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\"></p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">&nbsp;</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>k</em>&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;500</span>)&nbsp;&mdash; </p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">nn<span style=\"line-height: 19.6px;\">\'</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">.</span><span style=\"line-height: 19.6px;\">\'</span><span style=\"line-height: 1.4em;\"></span><span style=\"line-height: 1.4em;\">&nbsp;\'</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace;\">X</span><span style=\"line-height: 1.4em;\">\' </span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\"></span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\"></span><em>k</em>&thinsp;&times;&thinsp;<em>k&nbsp;</em><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\"></span></p>','5 2\n..XXX\nXX.XX\nX.XXX\nX...X\nXXXX.','10','0','<p><span style=\"color: #222222;\">&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px;\">2&thinsp;&times;&thinsp;2</span><span style=\"color: #222222;\">. 10</span></p>\n<p><img src=\"/data/10005/10005.png\" alt=\"\" /></p>\n<p>dfs and similardsuimplementation</p>','','2016-07-21 23:39:20',3,256,'N',3,3,0),(1034,'LRU','<p style=\"padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin: 0px 0px 1em !important;\">While creating high loaded systems one should pay a special attention to caching. This problem will be about one of the most popular caching algorithms called LRU (Least Recently Used).</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Suppose the cache may store no more than&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;objects. At the beginning of the workflow the cache is empty. When some object is queried we check if it is present in the cache and move it here if it\'s not. If there are more than&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;objects in the cache after this, the least recently used one should be removed. In other words, we remove the object that has the smallest time of the last query.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">Consider there are&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;videos being stored on the server, all of the same size. Cache can store no more than&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;videos and caching algorithm described above is applied. We know that any time a user enters the server he pick the video&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>i</em></span>&nbsp;with probability&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>. The choice of the video is independent to any events before.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The goal of this problem is to count for each of the videos the probability it will be present in the cache after&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">100</span></span>&nbsp;queries.</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">The first line of the input contains two integers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;and&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>k</em></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1&thinsp;&le;&thinsp;<em>k</em>&thinsp;&le;&thinsp;<em>n</em>&thinsp;&le;&thinsp;20</span>)&nbsp;&mdash; the number of videos and the size of the cache respectively. Next line contains&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>n</em></span>&nbsp;real numbers&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;(<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">0&thinsp;&le;&thinsp;<em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span>&thinsp;&le;&thinsp;1</span>), each of them is given with no more than two digits after decimal point.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">It\'s guaranteed that the sum of all&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\"><em>p</em><span class=\"lower-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\"><em>i</em></span></span>&nbsp;is equal to&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px; font-family: \'times new roman\', sans-serif; white-space: nowrap;\">1</span>.</p>','<p style=\"margin: 1.5em 0px 0px; padding: 0px; font-size: 14px; line-height: 1.4em; color: #222222;\">Print&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>n</em></span>&nbsp;real numbers, the&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>i</em></span>-th of them should be equal to the probability that the&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\"><em>i</em></span>-th video will be present in the cache after&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\">10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">100</span></span>&nbsp;queries. You answer will be considered correct if its absolute or relative error does not exceed&nbsp;<span class=\"tex-span\" style=\"font-size: 17.5px;\">10<span class=\"upper-index\" style=\"font-size: 13.125px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">&thinsp;-&thinsp;6</span></span>.</p>\n<p style=\"margin: 1.5em 0px 0px; padding: 0px; color: #222222;\"><span style=\"font-size: 14px; line-height: 1.4em;\">Namely: let\'s assume that your answer is&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; line-height: 1.4em;\"><em>a</em></span><span style=\"font-size: 14px; line-height: 1.4em;\">, and the answer of the jury is&nbsp;</span><span class=\"tex-span\" style=\"font-size: 17.5px; line-height: 1.4em;\"><em>b</em></span><span style=\"font-size: 14px; line-height: 1.4em;\">. The checker program will consider your answer correct, &nbsp; if &nbsp;|a-b|/max(1,b) &lt;= &nbsp;</span>10<span class=\"upper-index\">-6</span></p>','sample 1:\n3 1\n0.3 0.2 0.5\n\nsample 2:\n2 1\n0.0 1.0\n\nsample 3:\n3 2\n0.3 0.2 0.5\n\nsample 4:\n3 3\n0.2 0.3 0.5','sample1: 0.3 0.2 0.5\nsample2: 0.0 1.0 \nsampl