 INF=0x3f3f3f3f;\nconst int mod=1e9+7;\nchar s[N][N];\nint vis[N][N],sum[N][N],now[N*N],cnt,n,k,bcc[N*N];\nint dx[4]={0,0,-1,1};\nint dy[4]={-1,1,0,0};\nvoid dfs(int x,int y){\n  vis[x][y]=cnt,++bcc[cnt];\n  for(int i=0;i<4;++i){\n    int nx=x+dx[i],ny=y+dy[i];\n    if(nx<1||nx>n||ny<1||ny>n||s[nx][ny]==\'X\'||vis[nx][ny])continue;\n    dfs(nx,ny);\n  }\n}\nint cur;\nvoid del(int x,int y){\n   if(!vis[x][y])return;\n   if((--now[vis[x][y]])==0)cur-=bcc[vis[x][y]];\n}\nvoid add(int x,int y){\n  if(!vis[x][y])return;\n  if((++now[vis[x][y]])==1)cur+=bcc[vis[x][y]];\n}\nint cal(int x,int y){\n  return sum[x][y]-sum[x-k][y]-sum[x][y-k]+sum[x-k][y-k];\n}\nint main()\n{\n   scanf(\"%d%d\",&n,&k);\n   for(int i=1;i<=n;++i)\n    scanf(\"%s\",s[i]+1);\n   for(int i=1;i<=n;++i)\n    for(int j=1;j<=n;++j){\n      sum[i][j]=sum[i-1][j]+sum[i][j-1]-sum[i-1][j-1];\n      sum[i][j]+=s[i][j]==\'.\'?1:0;\n    }\n   for(int i=1;i<=n;++i)\n    for(int j=1;j<=n;++j)\n      if(s[i][j]==\'.\'&&!vis[i][j])++cnt,dfs(i,j); \n   int ret=0;\n   for(int i=1;i<=n-k+1;++i){\n      cur=0,memset(now,0,sizeof(now));\n      for(int p=i-1;p<=i+k;++p)\n        for(int q=1;q<=k+1;++q)\n           add(p,q);\n      del(i-1,k+1),del(i+k,k+1);\n      ret=max(ret,cur+k*k-cal(i+k-1,k));\n      for(int p=2;p<=n-k+1;++p){\n         for(int q=i;q<=i+k-1;++q)\n           del(q,p-2),add(q,p+k);\n         del(i-1,p-1);del(i+k,p-1);\n         add(i-1,p+k-1);add(i+k,p+k-1);\n         ret=max(ret,cur+k*k-cal(i+k-1,p+k-1));\n      }   \n   }   \n   printf(\"%d\\n\",ret);\n   return 0;\n}'),(1068,'#include <bits/stdc++.h>\n\n#define FOR(i,a,b) for (int i=(a),_b=(b);i<=_b;i++)\n#define pb push_back\n#define mp make_pair\n#define N 567\n\nusing namespace std;\n\nint dx[] = {0,0,1,-1}, dy[] = {1,-1,0,0};\nint n, k, rp[N*N], c[N*N], cum[N][N], cmpcnt[N*N], tot, ans;\nchar gr[N][N];\n\nint findr(int a){\n	if (rp[a]==a) return a;\n	return rp[a] = findr(rp[a]);\n}\nvoid join(int a, int b){\n	a = findr(a), b = findr(b);\n	if (a != b) {\n		rp[a] = b;\n		c[b] += c[a];\n	}\n}\nvoid add(int y, int x){\n	//printf(\"ADD %d %d %d\\n\", y, x, cmpcnt[rp[n*y+x]]);\n	int r = rp[n*y+x];\n	if (cmpcnt[r] == 0) tot += c[r];\n	cmpcnt[r]++;\n}\nvoid take(int y, int x){\n	int r = rp[n*y+x];\n	if (cmpcnt[r] == 1) tot -= c[r];\n	cmpcnt[r]--;\n}\nint main(){\n	//freopen(\"input.inp\",\"r\",stdin);\n	//freopen(\"output.out\",\"w\",stdout);\n	scanf(\"%d%d\", &n, &k);\n	FOR(i,0,n-1) scanf(\"%s\", gr[i]);\n	rp[N*N-1] = N*N-1;\n	FOR(i,0,n-1) FOR(j,0,n-1) {\n		if (gr[i][j]==\'.\') rp[n*i+j] = n*i+j, c[n*i+j] = 1;\n		else rp[n*i+j] = N*N-1;\n	}\n	FOR(i,0,n-1) FOR(j,0,n-1) if (gr[i][j]==\'.\') FOR(dd,0,3){\n		int ny = i + dy[dd], nx = j + dx[dd];\n		if (ny < 0 || nx < 0 || ny >= n || nx >= n) continue;\n		if (gr[ny][nx]==\'.\') join(n*i+j, n*ny+nx);\n	}\n	FOR(i,0,n-1) FOR(j,0,n-1)rp[n*i+j] = findr(n*i+j);\n	FOR(i,0,n-1) FOR(j,1,n) cum[i][j] = cum[i][j-1] + (gr[i][j-1]==\'X\');\n	FOR(i,0,n-k){\n		tot = 0;\n		FOR(j,0,n*n-1) cmpcnt[j] = 0;\n		FOR(j,0,k-1) FOR(kk,0,k-1) add(j, i+kk);\n		if (i != 0) FOR(j,0,k-1) add(j, i-1);\n		if (i != n-k) FOR(j,0,k-1) add(j, i + k);\n		if (k != n) FOR(j,0,k-1) add(k, i+j);\n		FOR(j,0,k-1) tot += cum[j][i + k] - cum[j][i];\n\n		FOR(j,0,n-k) {\n			//printf(\"%d %d %d\\n\", i, j, tot);\n			ans = max(ans, tot);\n			if (j==n-k) break;\n\n			if (j > 0) FOR(kk,0,k-1) take(j-1, i+kk);\n			if (j+k+1 < n) FOR(kk,0,k-1) add(j+k+1, i+kk);\n			if (i != 0) take(j, i-1), add(j+k, i-1);\n			if (i != n-k) take(j, i + k), add(j+k, i+k);\n			tot -= cum[j][i + k] - cum[j][i];\n			tot += cum[j+k][i+k] - cum[j+k][i];\n		}\n	}\n	printf(\"%d\", ans);\n\n	return 0;\n}'),(1069,'#include <bits/stdc++.h>\n\n#define FOR(i,a,b) for (int i=(a),_b=(b);i<=_b;i++)\n#define DOW(i,a,b) for (int i=(a),_b=(b);i>=_b;i--)\n#define x first\n#define y second\n#define pb push_back\n#define mp make_pair\n#define N 510\n\nusing namespace std;\n\ntypedef pair<int,int> PII;\ntypedef long long LL;\ntypedef unsigned long long ULL;\n\nconst int dx[] = {0,0,1,-1};\nconst int dy[] = {1,-1,0,0};\n\nchar grid[N][N];\nint rp[N*N], c[N*N], s[N][N], tot, ans, check[N*N];\nint n, k;\n\nvoid input(){\n	scanf(\"%d%d\",&n,&k);\n	rp[N*N-1] = N*N-1;\n	FOR(i,0,n-1){\n		scanf(\"%s\",grid[i]);\n		FOR(j,0,n-1)\n			if (grid[i][j] == \'.\') rp[n*i+j] = n*i+j, c[n*i+j] = 1;\n		else rp[n*i+j] = N*N-1;	\n	}\n}\n\nint findr(int a){\n	if (rp[a]==a) return a;\n	return rp[a] = findr(rp[a]);\n}\nvoid unite(int a, int b){\n	a = findr(a), b = findr(b);\n	if (a != b) {\n		rp[a] = b;\n		c[b] += c[a];\n	}\n}\nvoid add(int y, int x){\n	int r = rp[n*y+x];\n	if (check[r] == 0) tot += c[r];\n	check[r]++;\n}\nvoid remove(int y, int x){\n	int r = rp[n*y+x];\n	if (check[r] == 1) tot -= c[r];\n	check[r]--;\n}\n\nvoid init(){\n	FOR(i,0,n-1) FOR(j,0,n-1) if (grid[i][j] == \'.\') FOR(t,0,3){\n		int x = i + dx[t];\n		int y = j + dy[t];\n		if (x < 0 || y < 0 || x >= n || y >= n) continue;\n		if (grid[x][y] == \'.\') unite(n*i+j, n*x+y);\n	}\n	FOR(i,0,n-1) FOR(j,0,n-1) rp[n*i+j] = findr(n*i+j);\n	FOR(i,0,n-1) FOR(j,1,n)\n		s[i][j] = s[i][j-1] + (grid[i][j-1] == \'X\');\n}\n\nvoid solve(){\n	FOR(i,0,n-k){\n		tot = 0;\n		FOR(j,0,n*n-1) check[j] = 0;\n		FOR(j,0,k-1) FOR(t,0,k-1) add(j, i+t);\n		if (i != 0) FOR(j,0,k-1) add(j, i-1);\n		if (i != n-k) FOR(j,0,k-1) add(j, i + k);\n		if (k != n) FOR(j,0,k-1) add(k, i+j);\n		FOR(j,0,k-1) tot += s[j][i + k] - s[j][i];\n\n		FOR(j,0,n-k) {\n			ans = max(ans, tot);\n			if (j == n-k) break;\n\n			if (j > 0) FOR(t,0,k-1) remove(j-1, i+t);\n			if (j+k+1 < n) FOR(t,0,k-1) add(j+k+1, i+t);\n			if (i != 0) remove(j, i-1), add(j+k, i-1);\n			if (i != n-k) remove(j, i + k), add(j+k, i+k);\n			tot -= s[j][i + k] - s[j][i];\n			tot += s[j+k][i+k] - s[j+k][i];\n		}\n	}\n}\n\nvoid output(){\n	printf(\"%d\",ans);\n}\n\nint main(){\n	//freopen(\"input.inp\",\"r\",stdin);\n	//freopen(\"output.out\",\"w\",stdout);\n	input();\n	init();\n	solve();\n	output();\n	return 0;\n}'),(1070,'#include <bits/stdc++.h>\nusing names