turn reve;\n    }\n}'),(2487,'import java.util.Arrays;\nimport java.util.Scanner;\nimport java.lang.String;\npublic class Main {\n    public static void main(String[] args) {\n        Scanner sc = new Scanner(System.in);\n        String a = sc.nextLine();\n        char[] cha = a.toCharArray();\n        int k = cha.length;\n        int[] rang = new int[k];\n        String g = sc.nextLine();\n        char[] sha = g.toCharArray();\n        int[] gang = new int[k];\n        for (int i = 0; i < k; i++){\n            rang[i] = cha[i] - \'0\';\n        }\n        for (int i = 0; i < sha.length; i++){\n            gang[i] = sha[i] - \'0\';\n        }\n        Arrays.sort(rang);\n        for(int i=0;i<k;i++) {\n            if(rang[i]==0){\n            for (int b = 1; b < rang.length; b++) {\n                if (rang[b] != 0) {\n                    int temp = rang[b];\n                    rang[b] = rang[0];\n                    rang[0] = temp;\n                    break;\n                }\n            }\n            break;\n            }\n        }\n        int sum = 0;\n        int suum = 0;\n        for (int i = 0; i < rang.length; i++) {\n            sum = sum * 10 + rang[i];\n            suum = suum * 10 + gang[i];\n        }\n        if(sum==suum){\n            System.out.println(\"OK\");\n        }else{\n            System.out.println(\"WRONG_ANSWER\");\n        }\n    }\n}\n'),(2488,'import java.util.Arrays;\nimport java.util.Scanner;\nimport java.lang.String;\npublic class Main {\n    public static void main(String[] args) {\n        Scanner sc = new Scanner(System.in);\n        String a = sc.nextLine();\n        char[] cha = a.toCharArray();\n        int k = cha.length;\n        int[] rang = new int[k];\n        String g = sc.nextLine();\n        char[] sha = g.toCharArray();\n        int[] gang = new int[k];\n        for (int i = 0; i < k; i++){\n            rang[i] = cha[i] - \'0\';\n            gang[i] = sha[i] - \'0\';\n        }\n        Arrays.sort(rang);\n   