;\n        //\n        for (int number = 1; number <= N; number++) {\n            int dynmicNumber = number;\n            while (dynmicNumber % 2 == 0) { \n                count2++;\n                dynmicNumber /= 2;\n            }\n            while (dynmicNumber % 5 == 0) { \n                count5++;\n                dynmicNumber /= 5;\n            }\n        }\n        zeroNum=Math.min(count2, count5);\n        int i;\n        long j=1;\n        for(i=1;i<=N;i++)\n        { j*=i;}\n        j=(long)(j/(Math.pow(10,zeroNum)));\n        j=j%10;\n        System.out.println(j);\n    }\n}\n'),(2491,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args) {\n        int count2 = 0;\n        int count5 = 0;\n        int zeroNum=0;\n        Scanner input = new Scanner(System.in);\n        int N = input.nextInt();\n        for (int number = 1; number <= N; number++) {\n            int totalNumber = number;\n            while (totalNumber % 2 == 0) {\n                count2++;\n                totalNumber /= 2;\n            }\n            while (totalNumber % 5 == 0) {\n                count5++;\n                totalNumber /= 5;\n            }\n        }\n        zeroNum=Math.min(count2, count5);\n        int i;\n        long j=1;\n        for(i=1;i<=N;i++)\n        { j*=i;}\n        j=(long) (j/(Math.pow(10,zeroNum)));\n        j=j%10;\n        System.out.println(j);\n    }\n}\n'),(2492,'package cn.xmut.sorting;\n\nimport java.io.InputStream;\nimport java.util.Scanner;\n\npublic class Main {\n	public static void main(String[] args) {\n		char tmp = 0;\n		Scanner sc = new Scanner(System.in);\n		System.out.println(\":\");\n		String first = sc.next();\n		System.out.println(\":\");\n		String second = sc.next();\n		char[] chars =first.toCharArray();\n		for (int i = 0; i < chars.length; i++) {\n			for (int j = i; j < chars.length; j++) {\n				if (chars[j] < chars[i]) {\n					tmp = chars[i];\n					chars[i] = chars[j];\n					chars[j] = tmp;\n				}\n			}\n		}\n		if (chars[0] == \'0\') {\n			for (int i = 1; i < chars.length; i++) {\n				if (chars[i] != \'0\') {\n					tmp = chars[i];\n					chars[i] = chars[0];\n					chars[0] = tmp;\n					break;\n				}\n			}\n		}\n		String sorted = new String(chars);\n		if (sorted.equals(second)) {\n			System.out.println(\"OK\");\n		} else {\n			System.out.println(\"WRONG\");\n		}\n	}\n}\n');
