;\n        for (int i=2;i<=N/2;i++){\n            if (N<=1)\n                break;\n            if (isPrime(i)==-1){\n              int mod = N%i;\n               while (mod==0){\n                    if (primeMap.containsKey(i)){\n                        primeMap.put(i,primeMap.get(i)+1);\n                    }else{\n                        primeMap.put(i,1);\n                    }\n                   N/=i;\n                   mod= N%i;\n                   if (mod !=0)\n                       break;\n               }\n            }\n        }\n        StringBuilder sb = new StringBuilder();\n        //HashMap\n        Iterator it = primeMap.entrySet().iterator();\n        while(it.hasNext()){\n            Map.Entry entry = (Map.Entry) it.next();\n            int  key = (Integer) entry.getKey();\n            int val = (Integer) entry.getValue();\n            String string = key+\"(\"+val+\")\";\n            sb.append(string);\n        }\n    return num+\"=\"+sb.toString();\n    }\n    /**\n     * \n     * @param N\n     * @return\n     */\n\n   public static  int isPrime(int N){\n       for(int i=2;i<=Math.sqrt(N);i++){\n           int res = N%i;\n           if(res==0)\n               return 1;\n       }\n       return -1;\n   }\n\n}\n'),(2671,'import java.util.*;\npublic class Main{\n    public static void main(String[] args){\n        int q,m=0,n=1;\n        int j=0;\n        Scanner sc=new Scanner(System.in);\n        int number=sc.nextInt();\n        List<Integer> list=new ArrayList<Integer>();\n        int remain=number;\n        if(number>1) {\n            while (true) {\n                boolean flag = true;\n                for (int i = 2; i <= (int) Math.sqrt(remain); i++) {\n                    if (remain % i == 0) {\n                        list.add(i);\n                        remain = remain / i;\n                        flag = false;\n                        break;\n                    }\n                }\n                if (flag) {\n                 