\n\n    /**\n     *  \n     * @param N  int\n     * @return     \n     */\n    private static String primeRefactorying(int N){\n        HashMap<Integer, Integer> primateMap = new HashMap<>();\n\n        for (int i = 2; i <= N ; i++) {\n            if (N <=1){\n                break;\n            }\n            if (isPrime(i)==-1){\n                int mod = N%i;\n                while (mod==0){\n                    if (primateMap.containsKey(i)){//mapi\n                        primateMap.put(i,primateMap.get(i)+1);\n                    }else {\n                        primateMap.put(i,1);\n                    }\n                    N=N/i;\n                    mod = N%i;\n                    if (mod != 0){\n                        break;\n                    }\n                }\n\n            }\n        }\n\n\n        for (HashMap.Entry<Integer,Integer> entry:primateMap.entrySet()\n             ) {\n\n            System.out.print(entry.getKey());\n            System.out.print(\"(\" +entry.getValue()+\")\");\n\n        }\n           // System.out.print(primateMap.entrySet());\n\n        return  null;\n    }\n\n    /**\n     * isPrimeN \n     * @return\n     */\n    private static int isPrime(int N){\n        int sqrt = (int)Math.sqrt(N);\n        for (int i = 2; i <= sqrt; i++) {\n            int res = N%i;\n            if (res ==0)\n                return 1;\n        }\n        return -1;\n    }\n\n}\n'),(2699,'import java.util.Scanner;\npublic class Main {\n\n	\n	public static void main(String[] args) {\n		// TODO Auto-generated method stub\n		Scanner scanner=new Scanner(System.in);\n		int a=scanner.nextInt();\n		System.out.println(factorial(a));\n		\n\n	}\n	public static int factorial(int number){\n		int result=1;\n		for (int i=number;i>0;i--){\n			result*=i;\n			while(result%10==0){\n				int s=result/10;\n				result=s;\n			}\n			result=result%10;\n		}\n		return result;\n		\n	}\n\n}\n'),(2700,' public class Main {\n    public static void main(String[] args)\n    {