\n        int number = scnaner.nextInt();\n        int m = scnaner.nextInt();\n\n        int n = integeReverse(number);\n\n        if(m==n){\n            System.out.println(\"OK\");\n        }else{\n            System.out.println(\"WRONG_ANSWER\");\n        }\n        scnaner.close();\n    }\n    public static  int integeReverse(int number) {\n        ArrayList<Integer> intList = new ArrayList<Integer>();\n\n        while (true) {\n\n            int mod = number % 10;\n            intList.add(mod);\n\n            number /= 10;\n            if (number == 0)\n                break;\n        }\n        Collections.sort(intList);\n        int result = 0;\n        int num = 1;\n        boolean isFirst = true;\n        int firstNoZeroDigit = 0;\n\n        for (int i = 0; i < intList.size(); i++) {\n            firstNoZeroDigit = intList.get(i);\n            if (firstNoZeroDigit != 0) {\n                if (num>1&isFirst==true) {\n                    firstNoZeroDigit = firstNoZeroDigit * num;\n                }\n                isFirst = false;\n            }\n            if (isFirst) {\n                num = num *10;\n                continue;\n            }\n            result = result * 10 + firstNoZeroDigit;\n        }\n       return result;\n    }\n\n}\n\n'),(2710,'\nimport java.util.*;\n\npublic class Main {\n    public static void main(String[] args) {\n        Scanner scan = new Scanner(System.in);\n        String s=scan.nextLine();\n        String t=scan.nextLine();\n        scan.close();\n        String[] split = s.split(\"\");\n        int[] arr = new int[split.length];\n\n        for (int i=0; i<split.length;i++) {\n            int num= Integer.parseInt(split[i]);\n            arr[i]= num;\n        }\n\n        int temp;\n        for (int i=0;i<arr.length-1;i++){\n            for (int j=0;j<arr.length-1-i;j++){\n                if (arr[j]>arr[j+1]){\n                    temp = arr[j];\n                    arr[j] = arr[j+1];\n                    arr[j+1] = temp;\n                }\n            }\n        }\n\n        for (int i=0;i<arr.length-1;i++){\n            if(arr[i]==0){\n                continue;\n            }else {\n                temp = arr[i];\n                arr[i] = arr[0];\n                arr[0] = temp;\n                break;\n            }\n        }\n\n        String c= \"\";\n        for (int i : arr){\n            c+=i;\n        }\n            if (c.equals(t)){\n                System.out.println(\"OK\");\n            }else {\n                System.out.println(\"WRONG_ANSWER\");\n            }\n\n\n    }\n}\n\n\n'),(2711,'import java.util.Scanner;\npublic class Main {\n\n	/**\n	 * @param args\n	 */\n	public static void main(String[] args) {\n		// TODO Auto-generated method stub\n		Scanner scanner=new Scanner(System.in);\n		int a=scanner.nextInt();\n		System.out.println(factorial(a));\n		\n\n	}\n	public static int factorial(int number){\n		int result=1;\n		for (int i=number;i>0;i--){\n			result*=i;\n			\n		}\n		while(result%10==0){\n			int s=result/10;\n			result=s;\n		}\n		result=result%10;\n		return result;\n		\n	}\n\n}\n'),(2712,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args){\n        Scanner in = new Scanner(System.in);\n        StringBuilder mn = new StringBuilder(in.next());\n        StringBuilder mn2 = new StringBuilder(in.next());\n        StringBuilder mn3 = mn.reverse();\n        if (mn2.toString().compareTo(mn3.toString())==0){\n            System.out.println(\"YES\");\n        }else {\n            System.out.println(\"NO\");\n        }\n    }\n}\n'),(2713,'import java.util.Scanner;\n\n/**\n * Created by Administrator on 2016/7/27.\n */\npublic class Main{\n    public static void main(String[]args){\n        Scanner s=new Scanner(System.in);\n        int a;\n        a=s.nextInt();\n        int b;\n        b=s.nextInt();\n        int sum=a+b;\n        s.close();\n        System.out.print(sum);\n    }\n}'),(2714,'import java.util.Scanner;\nimport 