em.in);\n\n        int num = scanner.nextInt();\n        System.out.println(primeRefactorying(num));\n\n    }\n    /**\n     * \n     * @param N\n     */\n    public static  String primeRefactorying(int N){\n        int num = N;\n        HashMap<Integer,Integer> primeMap = new HashMap<>();\n        if (N==3|N==2|N==1)\n            return N+\"=\"+N+\"(\"+1+\")\";\n        int sqrt = (int) Math.sqrt(N);\n        for (int i=2;i<=N/2;i++){\n            if (N<=1)\n                break;\n            if (isPrime(i)==-1){\n              int mod = N%i;\n               while (mod==0){\n                    if (primeMap.containsKey(i)){\n                        primeMap.put(i,primeMap.get(i)+1);\n                    }else{\n                        primeMap.put(i,1);\n                    }\n                   N/=i;\n                   mod= N%i;\n                   if (mod !=0)\n                       break;\n               }\n            }\n        }\n        StringBuilder sb = new StringBuilder();\n        //HashMap\n        Iterator it = primeMap.entrySet().iterator();\n        while(it.hasNext()){\n            Map.Entry entry = (Map.Entry) it.next();\n            int  key = (Integer) entry.getKey();\n            int val = (Integer) entry.getValue();\n            String string = key+\"(\"+val+\")\";\n            sb.append(string);\n        }\n    return sb.toString();\n    }\n    /**\n     * \n     * @param N\n     * @return\n     */\n\n   public static  int isPrime(int N){\n       for(int i=2;i<=Math.sqrt(N);i++){\n           int res = N%i;\n           if(res==0)\n               return 1;\n       }\n       return -1;\n   }\n\n}\n'),(2747,'package Arithmetic;\n\nimport java.util.Scanner;\n\n/**\n * Created by lenovo on 2016/7/28.\n */\npublic class Main{\n    public static void main(String args[]){\n        int i;\n        int s = 0;\n        Scanner input = new Scanner(System.in);\n        int n = input.nextInt();\n        int m = input.nextInt();\n        for(i = 2;i <= n; 