                       } else {\n                                        if (s3.equals(\"paper\") && s1.equals(\"rock\") && s1.equals(\"rock\")) {\n                                            System.out.print(\"S\");\n                                        } else {\n                                            System.out.print(\"?\");\n                                        }\n\n                                    }\n                                }\n                            }\n                        }\n                    }\n                }\n            }\n        }\n        return 0;\n    }\n}'),(2801,'import java.util.ArrayList;\nimport java.util.Collections;\nimport java.util.Scanner;\nimport java.util.Stack;\n\npublic class Main{\n\n	public static boolean isInteger(String value) {\n		try {\n			Integer.parseInt(value);\n			return true;\n\n		} catch (NumberFormatException e) {\n			return false;\n		}\n	}\n\n	public static void main(String[] args) {\n\n		Stack<Integer> stack = new Stack<Integer>();\n\n		ArrayList<Integer> listInt = new ArrayList<Integer>();\n\n		Scanner reader = new Scanner(System.in);\n\n		String s = reader.next();\n\n		boolean b = true;\n\n		String[] dist = new String[] { s };\n\n		for (String li : dist) {\n\n			String[] nums = li.split(\"\\\\D+\");\n			for (String num : nums) {\n		\n				listInt.add(Integer.parseInt(num));\n\n			}\n\n		}\n\n\n		int j = 0;\n		for (int i = 0; i < s.length(); i++) {\n			if (!isInteger(String.valueOf(s.charAt(i)))) {\n\n				String c = String.valueOf(s.charAt(i));\n				if (c.equals(\"*\")) {\n					int m = stack.pop();;\n					int n = listInt.get(j++);\n					stack.push(m*n);\n					\n					\n					\n					b=false;\n					\n				}else\n					b=true;\n			} else {\n				\n				if (b) {\n					int n = listInt.get(j++);\n					stack.push(n);\n					b=false;\n				}\n			}\n\n		}\n		\n		int sum=0;\n		while(!stack.empty()){\n			sum += stack.pop();\n		}\n		\n		System.out.println(sum);\n\n	}\n}'),(2802,'import java.util.Scanner;\npubl