lic static void main(String[] args){\n        Scanner sd = new Scanner(System.in);\n        long a = sd.nextLong();\n        long b = sd.nextLong();\n        if (b==integeReverse(a)){\n            System.out.println(\"OK\");\n        }else {\n            System.out.println(\"WRONG_ANSWER\");\n        }\n    }\n\n    /**\n     * integeReverse \n     * @param number  \n     * @return \n     */\n\n    public static long integeReverse(long number){\n        ArrayList<Integer> inList = new ArrayList<>();\n        /**\n         * Integer int \n         */\n        // Integer num = new Integer(4);\n        while (true){\n            long mod = number%10;\n            inList.add((int) mod);\n            number = number/10;\n            if (number==0)\n                break;\n        }\n        int x ;\n        for (int i = 0; i < inList.size() ; i++) {\n            for (int j = i; j < inList.size()-1; j++) {\n                if (inList.get(i) > inList.get(j + 1)) {\n                    x = inList.get(i);\n                    inList.set(i, inList.get(j + 1));\n                    inList.set(j + 1, x);\n                }\n            }\n        }\n        int y = 0;\n        int z = 1;\n        while (( z<inList.size())&&(inList.get(0)==0)) {\n            if (inList.get(z)!=0)\n                y=inList.get(0);\n            inList.set(0,inList.get(z));\n            inList.set(z,y);\n            z+=1;\n        }\n        long result = 0;\n        int firstNoZeroDigit = 0;\n        for (int i = 0; i < inList.size(); i++) {\n            firstNoZeroDigit = inList.get(i);\n            /*if (i==0&&firstNoZeroDigit==0){\n                continue;\n            }*/\n\n            result = 10*result + firstNoZeroDigit;\n        } //\n        return result;\n    }\n}\n'),(2807,'import java.util.ArrayList;\nimport java.util.Collections;\nimport java.util.Scanner;\n\n/**\n * Created by Administrator on 2016/7/27.\n */\npublic class Main{\n    public static void main(String[] args){\n\n    