  int a = in.nextInt();\n        primeRefactorying(a);\n    }\n\n    public static void primeRefactorying(int num){\n        int count = 0;\n        int i = 2;\n        while (i <= num){\n            if (num % i == 0 && isPrime(i)){\n                num = num/i;\n                count++;\n                continue;\n            }\n            if (count >= 1)\n                System.out.print(i + \"(\" + count + \")\");\n            i++;\n            count = 0;\n        }\n        System.out.print(i + \"(\" + count + \")\");\n    }\n\n    public static boolean isPrime(int a) {\n        if (a < 2) {\n            return false;\n        } else {\n            for (int i = 2; i <= Math.sqrt(a); i++) {\n                if (a % i == 0) {\n                    return false;\n                }\n            }\n        }\n        return true;\n    }\n}\n\n'),(2823,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args) {\n        Scanner scanner = new Scanner(System.in);\n        int n = scanner.nextInt();\n        System.out.println(factorial(n));\n    }\n    public static long factorial(int n) {\n        long result = 1;\n        for (int i = 1; i <= n; i++) {\n            result *= i;\n        }\n        while(true){\n            if(result%10==0){\n                result=result/10;\n            }\n            if(result%10!=0) {\n                result = result % 10;\n                break;\n            }\n            }\n        return result;\n    }\n}\n'),(2824,'import java.math.BigInteger;\nimport java.util.Scanner;\n\npublic class Main{\n    static BigInteger b1 = BigInteger.valueOf(1);\n    static BigInteger b2= BigInteger.valueOf(2);\n    static BigInteger b3;\n    static BigInteger n = new BigInteger(\"1\");\n    public static void main(String[] args) {\n        Scanner scanner = new Scanner(System.in);\n        int m = scanner.nextInt();\n\n        for (int i = 1; i <= m; i++) {\n            b1 = b1.multiply(b2);\n            b3 = b1.subtract(n);\n        }\n        System.out.print(b3.toString());\n    }\n}'),(2825,'import java.util.ArrayList;\nimport java.util.Collections;\nimport java.util.Scanner;\nimport java.util.Stack;\n\npublic class Main{\n\n	public static boolean isInteger(String value) {\n		try {\n			Integer.parseInt(value);\n			return true;\n\n		} catch (NumberFormatException e) {\n			return false;\n		}\n	}\n\n	public static void main(String[] args) {\n\n		Stack<Integer> stack = new Stack<Integer>();\n\n		ArrayList<Integer> listInt = new ArrayList<Integer>();\n\n		Scanner reader = new Scanner(System.in);\n\n		String s = reader.next();\n\n		boolean b = true;\n\n		String[] dist = new String[] { s };\n\n		for (String li : dist) {\n\n			String[] nums = li.split(\"\\\\D+\");\n			for (String num : nums) {\n		\n				listInt.add(Integer.parseInt(num));\n\n			}\n\n		}\n\n\n		int j = 0;\n		for (int i = 0; i < s.length(); i++) {\n			if (!isInteger(String.valueOf(s.charAt(i)))) {\n\n				String c = String.valueOf(s.charAt(i));\n				if (c.equals(\"*\")) {\n					int m = stack.pop();;\n					int n = listInt.get(j++);\n					stack.push(m*n);\n					\n					\n					\n					b=false;\n					\n				}else\n					b=true;\n			} else {\n				\n				if (b) {\n					int n = listInt.get(j++);\n					stack.push(n);\n					b=false;\n				}\n			}\n\n		}\n		\n		int sum=0;\n		while(!stack.empty()){\n			sum += stack.pop();\n		}\n		\n	\n		System.out.println(sum%10000);\n\n	}\n}'),(2826,'\nimport java.math.BigInteger;\nimport java.util.Scanner;\npublic class Main{\n    public static void main(String args[]) {\n        Scanner scanner = new Scanner(System.in);\n        int n = scanner.nextInt();\n        BigInteger a = new BigInteger(\"2\");\n        System.out.println(a.pow(n).subtract(new BigInteger(\"1\")));\n    }\n}'),(2827,'import java.lang.reflect.Array;\nimport java.util.Arrays;\nimport java.util.Scanner;\n\n/**\n * Created by Administrator on 2016/7/28.\n */\npublic class Main {\n    public static void main(String[] args){\n  