);\n    }\n\n    public static void average() {\n        double average;\n        double sum = 0;\n\n        Scanner input = new Scanner(System.in);\n        int count = input.nextInt();\n\n        double[] juice = new double[count];\n        for (int i = 0; i < count; i++) {\n            juice[i] = input.nextDouble();\n            sum += juice[i];\n        }\n        average = sum / count;\n        DecimalFormat df = new DecimalFormat(\"###.0000\");\n        System.out.println(df.format(average));\n    }\n}\n'),(3224,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main {\n\n    public static void Factorization(int n){\n        int key=1;\n        int num=n;\n        ArrayList<Integer>list=new ArrayList<Integer>();\n        while(num>1){\n            for(int i=2;i<=num;i++){\n                if(num%i==0){\n                    key=i;\n                    list.add(key);\n                    break;\n                }\n            }\n            num=num/key;\n        }\n        int temp=0;\n        for(int i=temp;i<=list.size();i++){\n            int j=i+1;\n            if(i==list.size()-2){\n                if(list.get(i)!=list.get(j)){\n                    System.out.print(list.get(j)+\"(\"+1+\")\");\n                    break;\n                }\n                else if(list.get(i)==list.get(j)){\n                    System.out.print(list.get(j)+\"(\"+(j-temp+1)+\")\");\n                    break;\n                }\n            }\n            else if(list.get(i)!=list.get(j)){\n                System.out.print(list.get(i)+\"(\"+(j-temp)+\")\");\n                temp=j;\n                continue;\n            }\n        }\n    }\n    public static void main(String[] args) {\n        java.util.Scanner input = new java.util.Scanner(System.in);\n        int n = input.nextInt();\n        Factorization(n);\n    }\n}'),(3225,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main {\n\n    public static void Factorization(int n){\n        int key=1;\n        int num=n;\n        ArrayList<Integer>list=new ArrayList<Integer>();\n        while(num>1){\n            for(int i=2;i<=num;i++){\n                if(num%i==0){\n                    key=i;\n                    list.add(key);\n                    break;\n                }\n            }\n            num=num/key;\n        }\n        int temp=0;\n        for(int i=temp;i<list.size()-1;i++){\n            int j=i+1;\n            if(i==list.size()-2){\n                if(list.get(i)!=list.get(j)){\n                    System.out.print(list.get(j)+\"(\"+1+\")\");\n                    break;\n                }\n                else if(list.get(i)==list.get(j)){\n                    System.out.print(list.get(j)+\"(\"+(j-temp+1)+\")\");\n                    break;\n                }\n            }\n            else if(list.get(i)!=list.get(j)){\n                System.out.print(list.get(i)+\"(\"+(j-temp)+\")\");\n                temp=j;\n                continue;\n            }\n        }\n    }\n    public static void main(String[] args) {\n        java.util.Scanner input = new java.util.Scanner(System.in);\n        int n = input.nextInt();\n        Factorization(n);\n    }\n}'),(3226,'import java.math.BigDecimal;\nimport java.util.Scanner;\n\n\npublic class Main {\n    public static void main(String[] args){\n\n        double result = 0.0000;\n        double num = 0;\n        try{\n            Scanner scanner = new Scanner(System.in);\n            int orinumber = scanner.nextInt();\n\n            if (orinumber>=1 && orinumber <=100){\n                for (int a = 0 ; a<orinumber ;a++){\n                    Double every = scanner.nextDouble();\n                    num = num + every ;\n                }\n                result = num/orinumber ;\n                BigDecimal a = new BigDecimal(result);\n                java.text.DecimalFormat df = new java.text.DecimalFormat(\"0.0000\");\n                System.out.print(df.format(a));\n            