igDecimal;\nimport java.text.DecimalFormat;\nimport java.util.ArrayList;\nimport java.util.Collections;\nimport java.util.Scanner;\n\npublic class Main{\n	\n\n	public static void main(String[] args) {\n		\n		Scanner reader = new Scanner(System.in);\n		\n		ArrayList<Double> list = new ArrayList<Double>();\n		\n		int n = reader.nextInt();\n		double fenzi = 0;\n		for(int i=0; i<n; i++){\n			list.add(reader.nextDouble());\n			fenzi += list.get(i);\n		}\n		\n		int fenmu = 100*n;\n		\n		DecimalFormat df = new DecimalFormat(\"#.0000\");\n		\n		System.out.println(df.format((fenzi/fenmu)*100));\n		\n		\n\n	}\n\n}'),(3231,'import java.util.*;\n\n\n/**\n * Created by mona on 2016/7/28.\n */\npublic class Main {\n\n    public static void main(String[] args){\n        int num = 0;\n        List<Integer> list = new ArrayList<Integer>();\n        Map<Integer,Integer> map= new LinkedHashMap<Integer,Integer>();\n        Scanner scanner = new Scanner(System.in);\n        //int a = scanner.nextInt();\n\n        while (scanner.hasNext())\n        {\n            int a = scanner.nextInt();\n            if(a==0)\n            {\n                break;\n            }\n            else\n            {\n                list.add(a);\n            }\n\n        }\n\n        for(Integer ii : list)\n        {\n            int b = ii ;\n            for(int i = 1 ; i> 0 ;i++){\n                if (b-i >=0)\n                {\n                    if (b-i >0){\n\n                        num = num + i*i;\n                        b = b - i ;\n                    }else\n                    {\n                        num = num +  i*i;\n//                        System.out.print(num);\n                        map.put(ii,num);\n                        break;\n                    }\n                }\n                else\n                {\n                    num = num + b * i;\n//                    System.out.print(num);\n                    map.put(ii,num);\n                    break;\n                }\n            }\n             num = 0;\n        }\n        for (Map.Entry<Integer, Integer> entry : map.entrySet()){\n            System.out.println(entry.getKey() + \" \" + entry.getValue());\n        }\n\n    }\n}'),(3232,'import java.util.Scanner;\n\npublic class Main {\n    \n    public static void main(String[] args) {\n\n        Scanner in = new Scanner(System.in);\n        String str1 = in.next();\n        long num = 0;\n        for(int i = 0;i<str1.length();i++)\n        {\n            for(int j = 0;j<str1.length();j++)\n            {\n                if(str1.charAt(i)==str1.charAt(j))\n                    num++;\n            }\n        }\n        System.out.println(num);\n    }\n}'),(3233,'import java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		Scanner s = new Scanner(System.in);\n		int n=s.nextInt();\n		System.out.println((n-1)*2+1);\n\n	}\n\n}'),(3234,'import java.math.BigInteger;\nimport java.util.Scanner;\n\n/**\n * Created by Administrator on 2016/7/28.\n */\npublic class Main{\n    public static void main(String [] args){\n       Scanner in = new Scanner(System.in);\n        int n = in.nextInt();\n\n\n        if (n<64) {\n            System.out.println(sum(n)-1);\n        }\n\n        if (n==64){\n            BigInteger bigInteger = new BigInteger(\"10\");\n            bigInteger=bigInteger.pow(18);\n            bigInteger=bigInteger.multiply(new BigInteger((\"16\")));\n\n            bigInteger = new BigInteger(\"2\");\n            bigInteger=bigInteger.pow(64);\n            System.out.println(bigInteger);\n\n\n        }\n\n\n    }\n    static Long sum(int n) {\n        long sum = 1;\n        for (int i = 0; i < n; i++) {\n\n            sum = sum * 2;\n\n        }\n\n        return sum;\n    }\n}\n'),(3235,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args) {\n        int a,b,c;\n        Scanner scan=new Scanner(System.in);\n\n        while (scan.hasNext()){\n            a=scan.nextInt();\n            b=scan.nextInt();\n            c=scan.nextInt();\n            int result=(int)((Math.pow(a%c,b))%c);\n            System.out.println(result);\n        }\n    }\n\n}\n'),(3236,'import java.util.Scanner;\nimport java.util.Stack;\npublic class Main{\n    public static void main(String[]args){\n        Scanner scanner = new Scanner(System.in);\n        String expression = scanner.nextLine();\n        String[] nums = expression.split(\"\\\\D\");\n        String[] signs = expression.split(\"\\\\d+\");\n        long result = 0;\n        int numLen = nums.length;\n        int sigLen = signs.length;\n        int i=0,j=0;\n        Stack<String> stack = new Stack();\n        for(i=0,j=i+1; j<sigLen||i<numLen;){\n            if(stack.isEmpty()||stack.peek().matches(\"\\\\D\")){\n                stack.push(nums[i]);\n                i++;\n            }\n            if(j<sigLen){\n                if(signs[j].equals(\"+\")){\n                    stack.push(signs[j]);\n                }else {\n                    int a = Integer.parseInt(stack.pop());\n                    int re = a * Integer.parseInt(nums[i]);\n                    i++;\n                    stack.push(String.valueOf(re));\n                }\n                j++;\n            }\n        }\n        while(!stack.isEmpty()){\n            String num = stack.pop();\n            if(!num.equals(\"+\")){\n                result += Long.parseLong(num);\n            }\n        }\n        System.out.println(result%10000);\n    }\n}\n'),(3237,'import java.util.*;\n\n\n/**\n * Created by mona on 2016/7/28.\n */\npublic class Main {\n\n    public static void main(String[] args){\n        int num = 0;\n        List<Integer> list = new ArrayList<Integer>();\n        Map<Integer,Integer> map= new LinkedHashMap<Integer,Integer>();\n        Scanner scanner = new Scanner(System.in);\n        //int a = scanner.nextInt();\n\n        while (scanner.hasNext())\n        {\n            int a = scanner.nextInt();\