lic static void main(String[] args) {\n		Scanner s = new Scanner(System.in);\n		String s1 = s.nextLine();\n		int sum = 0;\n\n		String[] s2 = s1.split(\"\\\\+\");\n		for (int i = 0; i < s2.length; i++) {\n			sum = sum + multi(s2[i]);\n		}\n\n		String str = String.valueOf(sum);\n\n		if (sum <= 10000) {\n			System.out.println(sum);\n		} else {\n\n			if (str.length() > 4) {\n				String sss = String.valueOf(sum);\n				String ss = sss.substring(sss.length() - 4, sss.length());\n				System.out.println(Integer.valueOf(ss));\n\n			}\n		}\n\n	}\n\n	private static int multi(String temp) {\n		String[] temp2 = temp.split(\"\\\\*\");\n		if (temp2.length == 1) {\n			return Integer.parseInt(temp2[0]);\n		} else {\n			int mul = 1;\n			for (int j = 0; j < temp2.length; j++) {\n				mul = mul * Integer.parseInt(temp2[j]);\n			}\n			return mul;\n		}\n	}\n}\n'),(3276,'import java.util.Scanner;\npublic class Main {\n    public static void main(String[] args) {\n        int a,b,c;\n        Scanner scan=new Scanner(System.in);\n\n        while (scan.hasNext()){\n            a=scan.nextInt();\n            b=scan.nextInt();\n            c=scan.nextInt();\n            // (a^b)mod(c) = ((a mod c )^b)mod c\n            long result=(long)((Math.pow(a%c,b))%c);\n            System.out.println(result);\n        }\n    }\n\n}\n'),(3277,'import java.util.Scanner;\npublic class Main{\n    public static void main(String [] args){\n        Scanner scanner = new Scanner(System.in);\n        String s = scanner.nextLine();\n        String [] arr = s.split(\"\\\\+\");\n        String [] mul;\n        int sum = 0;\n        if(arr[0].contains(\"*\")){\n            mul = arr[0].split(\"\\\\*\");\n            sum = Integer.parseInt(mul[0]);\n            if(sum>10000) sum %= 10000;\n            for(int j = 1, len = mul.length; j < len; j ++){\n                int m = Integer.parseInt(mul[j]) > 10000 ? Integer.parseInt(mul[j]) % 10000: Integer.parseInt(mul[j]);\n                sum = sum * m;\n            }\n    