break;//\n		   case -1:insert(wa,a,str,5);break; // \n		   }\n		   cout<<a<<endl;\n		}\n\n  return 0;\n}'),(3493,'import java.util.ArrayList;\n\npublic class Main {\n    public static void main(String[] args) {\n        java.util.Scanner input = new java.util.Scanner(System.in);\n        int n=input.nextInt();\n        int[] str01=new int[n];\n        int[] str02=new int[n];\n        int[] Temp=new int[n];\n        int i,j,k;\n        int total=0;\n        int a=str01.length-1;\n        for(i=0;i<n;i++){\n            str01[i] = input.nextInt();\n        }\n        for(i=0;i<n;i++){\n            str02[i] = input.nextInt();\n        }\n        if(equals(str01,str02)==true){\n            System.out.println(0);\n        }\n        else{\n            for (i=a;i>=0;i--){\n                for(j=str01.length-1;j>=0;j--){\n                    if(str01[i]==str02[j]&&i==j){\n                        Temp[i]=str01[i];\n                        continue;\n                    }\n                    else if(str01[i]==str02[j]&&i!=j){\n                        ++total;\n                        Temp[j]=str01[i];\n                        for(k=j;k<str01.length-1;k++){\n                            Temp[k+1]=str01[k];\n                        }\n                        for(k=j;k<str01.length-1;k++){\n                            str01[k+1]=Temp[k+1];\n                        }\n                        a+=1;\n                    }\n                }\n            }\n            System.out.println(total);\n        }\n    }\n    public static boolean equals(int[] str01,int[] str02) {\n        for (int i=0; i<str01.length;i++)\n            if (str01[i]!=str02[i])\n                return false;\n            return true;\n    }\n}');
INSERT INTO `source_code` VALUES (3494,'\nimport java.util.Scanner;\n\npublic class Main {\n    public static void main(String[] args){\n        Scanner scanner=new Scanner(System.in);\n        int s=0;\n        int n=scanner.nextInt();\n        int arra[]=new int[n];\n         for(int i=0;i<n;i++){\n            arra[i]=scanner.nextInt();\n            s+=arra[i];\n        }\n\n        double f = 0;\n         f=(double) s/n;\n        DecimalFormat mm=new DecimalFormat(\"#.0000\");\n        System.out.println(mm.format(f));}\n    }\n\n'),(3495,'import java.util.Scanner;\npublic class Main {\n    public static void main(String args[]) {\n        Scanner sc = new Scanner(System.in);\n        int N = sc.nextInt();\n        int M = sc.nextInt();\n        int a = N;\n        int result=0;\n        int q= M % 10 %10;\n        if (q == 0 || q == 5) {\n            System.out.print(\"0\");\n        } else {\n            while(true){\n                if (M <= 10000) {\n                    if (N >= 0 && N <= 9) {\n                        if (a % M == 0) {\n                            result = Long.toString(a).length();\n                            System.out.print(result);\n                            break;\n                        }\n                        a = a * 10 + N;\n                    }\n                }\n            }\n        }\n    }\n}\n\n'),(3496,'import java.util.*;\npublic class Main {\n    public static void main(String[] args) {\n        Scanner cin = new Scanner(System.in);\n            int day = cin.nextInt();\n            if(day != 0)\n            System.out.println(day + \" \" + func(day));\n    }\n     static int func(int day)\n    {\n        int sum = 1;\n        int k=2;\n        int m=0;\n        if(day == 1) return 1;\n        for(int i = 2; i <= day; i++)\n        {\n            if(k == m)\n            {\n                m = 0;\n                k ++;\n            }\n            sum += k;\n            m ++;\n        }\n        return sum;\n    }\n}'),(3497,'\n\nimport java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		Scanner sc = new Scanner(System.in);\n		int in = sc.nextInt();\n		int num[] = new int[in];\n		double sum=0;\n		double avg;\n		for (int i=0;i<num.length;i++){\n			num[i]=sc.nextInt();\n			sum+=num[i];\n			}\n			avg=sum/in;\n	\n		System.out.println(String.format(\"%.4f\", avg));\n		\n	}\n\n}\n'),(3498,'import java.util.Scanner;\n\n/**\n * Created by lizi on 2016/7/29 0029.\n */\npublic class Main{\n   public static void main(String[] args){\n       Scanner scanner=new Scanner(System.in);\n       int a=scanner.nextInt();\n       int b=scanner.nextInt();\n       int c=scanner.nextInt();\n       int m,n;\n       m=(int)Math.pow(a,b);\n       n=m%c;\n       System.out.print(n);\n\n   }\n}'),(3499,'import java.util.ArrayList;\n\n/**\n * Created by Mr.Tang on 2016/7/29.\n */\npublic class Main {\n    public static void main(String[] args){\n        java.util.Scanner input = new java.util.Scanner(System.in);\n        while (true){\n            int li = input.nextInt();\n            if (li == 0)\n                break;\n\n            int N = li;\n            int M = input.nextInt();\n            int k = 0;\n            k++;\n            int mod = N%M;\n            int weiShu = WeiShu(N);\n            while (mod !=0){\n                k++;\n                if (k>10000){\n                    k = 0;\n                    break;\n                }\n                mod = ((int)( mod*Math.pow(10,weiShu))+N)%M;\n            }\n            System.out.println(k);\n        }\n\n    }\n    static int WeiShu(int N){\n        for (int i = 1; i <5 ; i++) {\n            if (N < Math.pow(10,i))\n                return i;\n        }\n        return 5;\n    }\n}'),(3500,'import java.util.Scanner;\n\n/**\n * Created by lenovo on 2016/7/29.\n */\npublic class Main {\n    public static void main(String[] args) {\n        Scanner scanner = new Scanner(System.in);\n        int daynumber = scanner.nextInt();   //\n        int sum = 0;\n        int j=1,temp=1;         //j temp\n       for (int i=1;i<=daynumber;i++){\n           sum=sum+j;     \n           temp--;\n           if(temp == 0){\n               temp = ++j;\n           }\n       }\n       System.out.println(sum);\n    }\n\n}\n'),(3501,'import java.util.Scanner;\n\n/**\n * Created by Administrator on 2016/7/29 0029.\n */\npublic class Main{\n    public static void main(String[] args){\n        double n;\n        double sum;\n        Scanner scan=new Scanner(System.in);\n        n=scan.nextInt();\n        System.out.println(sum=Math.pow(2,n)-1);\n    }\n}'),(3502,'import java.text.DecimalFormat;\nimport java.util.Scanner;\npublic class Main {\n    public static void main(String[] args) {\n        DecimalFormat df=new DecimalFormat(\"#.0000\");\n        Scanner scanner=new Scanner(System.in);\n        int n=scanner.nextInt();\n        int[] array=new int[n];\n        double ave=0;\n        double sum=0;\n        for (int i = 0; i < n ; i++) {\n            array[i]=scanner.nextInt();\n            sum+=array[i];\n        }\n        ave=sum/n;\n        System.out.println(df.format(ave));\n    }\n}'),(3503,'/**\n * Created by Dell on 2016/7/29.\n */\nimport java.util.*;\npublic class Main {\n    public static void main(String[] args){\n        Scanner sc=new Scanner(System.in);\n        String x=sc.next();\n        String y=sc.next();\n        String z=sc.next();\n        String r=\"rock\";\n        String p=\"paper\";\n        String s=\"scissors\";\n        while(true) {\n            if (x.equals(r) && y.equals(s) && z.equals(s) \n                    || x.equals(p) && y.equals(r) && z.equals(r) \n                    || x.equals(s) && y.equals(p) && z.equals(p)) {\n                System.out.println(\"F\");\n                break;\n            } else if (y.equals(r) && x.equals(s) && z.equals(s) \n                    || y.equals(p) && x.equals(r) && z.equals(r) \n                    || y.equals(s) && x.equals(p) && z.equals(p)) {\n                System.out.println(\"M\");\n                break;\n            } else if (z.equals(r) && x.equals(s) && y.equals(s) \n                    || z.equals(p) && x.equals(r) && y.equals(r) \n                    || z.equals(s) && x.equals(p) && y.equals(p)) {\n                System.out.println(\"S\");\n                break;\n            }else{\n                System.out.println(\"?\");\n                break;\n            }\n        }\n    }\n}\n'),(3504,'import java.math.BigDecimal;\nimport java.util.Scanner;\npublic class Main{\n    public static void main(String[]args){\n        Scanner scanner = new Scanner(System.in);\n        while(true){\n            String[] enter= scanner.nextLine().split(\" \");\n            if(enter.length<=1){\n                break;\n            }\n            BigDecimal t = new BigDecimal(enter[0]);\n            int n = Integer.parseInt(enter[1]);\n            BigDecimal result = BigDecimal.ONE;\n            for(int i=1; i<=n; i++){\n                result = result.multiply(t);\n            }\n            String res = result.toString();\n            if(res.contains(\"E\")){\n                String[] rr = res.split(\"E-\");\n                int len = Integer.parseInt(rr[1]);\n                StringBuffer strb = new StringBuffer(rr[0]);\n                if(strb.length()>1){\n                    strb.deleteCharAt(1);\n                }\n                for(int i=1; i<len; i++){\n                    strb.insert(0,\'0\');\n\n                }\n                strb.insert(0,\'.\');\n                res = strb.toString();\n            }\n            int len = res.length();\n            if(res.contains(\".\")&&res.charAt(len-1)==\'0\'){\n                int i;\n                for(i=len-1; i>=0; i--){\n                    if(res.charAt(i)!=\'0\'){\n                        break;\n                    }\n                }\n                if(res.charAt(i)==\'.\'){\n                    res = res.substr