}\n\n        }\n        for(int i = 0;i < arr.length; i++) {\n            if(arr[i] == true) {\n                return i+1;\n            }\n        }\n        return -1;\n    }\n}'),(3518,'import java.math.BigDecimal;\nimport java.util.Scanner;\npublic class Main{\n    public static void main(String[]args){\n        Scanner scanner = new Scanner(System.in);\n        while(scanner.hasNextLine()){\n            String[] enter= scanner.nextLine().split(\" \");\n            BigDecimal t = new BigDecimal(enter[0]);\n            int n = Integer.parseInt(enter[1]);\n            BigDecimal result = BigDecimal.ONE;\n            for(int i=1; i<=n; i++){\n                result = result.multiply(t);\n            }\n            String res = result.toString();\n            if(res.contains(\"E\")){\n                String[] rr = res.split(\"E-\");\n                int len = Integer.parseInt(rr[1]);\n                StringBuffer strb = new StringBuffer(rr[0]);\n                if(strb.length()>1){\n                    strb.deleteCharAt(1);\n                }\n                for(int i=1; i<len; i++){\n                    strb.insert(0,\'0\');\n\n                }\n                strb.insert(0,\'.\');\n                res = strb.toString();\n            }\n            int len = res.length();\n            if(res.contains(\".\")&&res.charAt(len-1)==\'0\'){\n                int i;\n                for(i=len-1; i>=0; i--){\n                    if(res.charAt(i)!=\'0\'){\n                        break;\n                    }\n                }\n                if(res.charAt(i)==\'.\'){\n                    res = res.substring(0,i);\n                }else{\n                    res = res.substring(0,i+1);\n                }\n\n            }\n            System.out.println(res);\n        }\n    }\n}'),(3519,'import java.util.ArrayList;\nimport java.util.Scanner;\nimport java.util.Stack;\n\npublic class Calculate {\n    public ArrayList<String> getStringList(String str) {\n        ArrayList<String> result = new ArrayList<String>();\n        String num = \"\";\n        for (int i = 0; i < str.length(); i++) {\n            if (Character.isDigit(str.charAt(i))) {\n                num = num + str.charAt(i);\n            } else {\n                if (num != \"\") {\n                    result.add(num);\n                }\n                result.add(str.charAt(i) + \"\");\n                num = \"\";\n            }\n        }\n        if (num != \"\") {\n            result.add(num);\n        }\n        return result;\n    }\n\n    public ArrayList<String> getPostOrder(ArrayList<String> inOrderList) {\n\n        ArrayList<String> result = new ArrayList<String>();\n        Stack<String> stack = new Stack<String>();\n        for (int i = 0; i < inOrderList.size(); i++) {\n            if (Character.isDigit(inOrderList.get(i).charAt(0))) {\n                result.add(inOrderList.get(i));\n            } else {\n                switch (inOrderList.get(i).charAt(0)) {\n                    case \'(\':\n                        stack.push(inOrderList.get(i));\n                        break;\n                    case \')\':\n                        while (!stack.peek().equals(\"(\")) {\n                            result.add(stack.pop());\n                        }\n                        stack.pop();\n                        break;\n                    default:\n                        while (!stack.isEmpty() && compare(stack.peek(), inOrderList.get(i))) {\n                            result.add(stack.pop());\n                        }\n                        stack.push(inOrderList.get(i));\n                        break;\n                }\n            }\n        }\n        while (!stack.isEmpty()) {\n            result.add(stack.pop());\n        }\n        return result;\n    }\n\n    public Integer calculate(ArrayList<String> postOrder) {\n        Stack stack = new Stack();\n        for (int i = 0; i < postOrder.size(); i++) {\n            if (Character.isDigit(postOrder.get(i).charAt(0))) {\n                stack.push(Integer.parseInt(postOrder.get(i)));\n            } else {\n                Integer back = (Integer) stack.pop();\n                Integer front = (Integer) stack.pop();\n                Integer res = 0;\n                switch (postOrder.get(i).charAt(0)) {\n                    case \'+\':\n                        res = front + back;\n                        break;\n                    case \'*\':\n                        res = front * back;\n                        break;\n                }\n                stack.push(res);\n            }\n        }\n        return (Integer) stack.pop();\n    }\n\n    public static boolean compare(String peek, String cur) {\n        if (\"*\".equals(peek) && (\"*\".equals(cur) || \"+\".equals(cur))) {\n            return true;\n        } else if (\"+\".equals(peek) && (\"+\".equals(cur))) {\n            return true;\n        }\n        return false;\n    }\n\n    public static void main(String[] args) {\n        Calculate calculate = new Calculate();\n        Scanner scanner = new Scanner(System.in);\n        String s = scanner.next();\n        ArrayList result = calculate.getStringList(s);  //StringList\n        result = calculate.getPostOrder(result);   //\n        int i = calculate.calculate(result);\n        String b = String.valueOf(i);\n        int x = Integer.parseInt(b.substring(b.length() - 4, b.length()));\n        System.out.println(x);\n    }\n}'),(3520,'import java.math.BigDecimal;\nimport java.util.Scanner;\npublic class Main{\n    public static void main(String[]args){\n        Scanner scanner = new Scanner(System.in);\n        while(scanner.hasNextLine){\n            String[] enter= scanner.nextLine().split(\" \");\n            if(enter.length!=2){\n                break;\n            }\n            BigDecimal t = new BigDecimal(enter[0]);\n            int n = Integer.parseInt(enter[1]);\n            BigDecimal result = BigDecimal.ONE;\n            for(int i=