et(source.t, 0, sizeof(source.t));\n  Ans = 1;\n\n  while ((t = getchar()) < \'1\' || t > \'9\');\n  do num[++w] = t - \'0\'; while((t = getchar()) >= \'0\' && t <= \'9\');\n  REP(i, w / 2) swap(num[i], num[w - i + 1]);\n  for (int i = 1; i <= w; i += 4)\n  {\n      k = 0;\n      for (int j = i + 3; j >= i; --j) k = k * 10 + num[j];\n      source.t[i / 4 + 1] = k;\n  }\n  source.w = (w + 3) / 4;\n}\nvoid Work()\n{\n  int my;\n  Bignum c;\n  Bignum s = source;\n  do\n  {\n      divide(s, 5, my);\n      c = c + s;\n      REP(i, my) Ans *= i; Ans %= 5;\n  }while (s.w);\n  if (c.t[1] & 1) Ans *= -1;\n  divide(c, 4, my);\n  REP(i, my) Ans *= 3; Ans = (Ans + 1000) % 5;\n  if (source.w == 1 && source.t[1] == 1) cout << pp[0] << endl;\n  else cout << pp[Ans] << endl;\n}\nint main()\n{\n  int T;\n  freopen(\"a.in\", \"r\", stdin);\n  freopen(\"a.out\", \"w\", stdout);\n  scanf(\"%d\", &T);\n  while (T--)\n  {\n      Init();\n\n      Work();\n  }\n  fclose(stdin);\n  fclose(stdout);\n  return 0;\n}'),(3632,'import java.math.BigDecimal;\nimport java.util.Scanner;\n\npublic class Main {\n\n    public static void main(String[] args) {\n	// write your code here\n        Scanner s = new Scanner(System.in);\n        while(s.hasNext())\n        {\n            BigDecimal a=s.nextBigDecimal();\n            int n=s.nextInt();\n            a=a.pow(n).stripTrailingZeros();//\n            String m=a.toPlainString();//\n            if(m.charAt(0)==\'0\')\n                m=m.substring(1);\n            System.out.println(m);\n        }\n    }\n}'),(3633,'import java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		Scanner s= new Scanner(System.in);\n        String str =s.nextLine();\n        char c[] =str.toCharArray();\n        int count=0;\n        for(int i=0;i<c.length;i++){\n        	 for(int j=0;j<c.length;j++){\n        		 if( c[i]== c[j]){\n        			 count++;\n        		 }\n        	 \n        	 }\n        	\n        }\n        System.out.printl